import React from 'react';
import {Link} from 'react-router-dom';

function Menu() {
  return (
  <nav>
    <h1>Epic Cards Shop</h1>
    <ul>
      <li><Link to="/home">Home</Link></li>
      <li>Carrinho</li>
      <li><Link to="/about">Sobre</Link></li>
    </ul>
  </nav>
  );
}

export default Menu;
